import requests
from selenium import webdriver
from selenium.webdriver.chrome.service import Service
from selenium.webdriver.chrome.options import Options

url = "https://finance.yahoo.com/chart/AAPL#"

response = requests.get(url)

t = response.text

value = "BTC-USD"

if value in t:
    print("Yes")
else:
    print("No")
    
# specify the path to Chrome driver
chrome_driver_path = "./chromedriver.exe"

# create a new ChromeOptions instance
chrome_options = Options()

# create a new Chrome browser instance
driver = webdriver.Chrome(service=Service(executable_path=chrome_driver_path), options=chrome_options)
driver.get(url)
ps = driver.page_source

if value in ps:
    print("Yes")
else:
    print("No")

